        let res = await Apis.get(endpoints['courses']).then(datas=>{
            setCourses(datas.data.results)
            console.log(datas.data.results)
        })
    })

    return(

<Container>
    <Row>
        {courses.map(u=> <MyCard courses = {u}/>)}
    </Row>
</Container>

